('0de6de96-f4c1-4811-9961-f8c5ce2a324a', '381e9201-5822-4783-919f-13f83bd6e10b', 3, 'O27GV8BANXQ', '0G47HIW3SHCPQC7ER7R7', 'Ktc Almond Oil, Castor Oil And Coconut Oil Combo', '3900', '10500', 1, 9, 'Ktc', 'Available', 1, 1, '<p><b>The combination of three great oils</b> from nature\'s foods.&nbsp; Known \r\nfor their great benefits when used for both hair and skin care.A \r\ncombination of these three oils or used singly can be used to moisturize\r\n the skin and hair, relieve allergy and treat skin blemishes.<b><br></b>Coconut oilIts natural antioxidant properties make it great for stopping wrinkles and skin irritation.<br>Almond oilThanks to the<b>&nbsp;</b>Vitamin E<b>,</b> sweet almond oil keeps your&nbsp;skin&nbsp;cells healthy, protects your&nbsp;skin&nbsp;from UV radiation damage, and helps your<b>&nbsp;</b>skin<b>&nbsp;</b>look\r\n smooth, soft, and free of fine lines. The fatty acids help \r\nyour&nbsp;skin&nbsp;retain moisture and can heal chapped and irritated&nbsp;skin. Plus,\r\n the&nbsp;vitamin A&nbsp;can help reduce&nbsp;acne.<br>Castor oilAcne: The \r\nantimicrobial and&nbsp;anti-inflammatory&nbsp;properties of castor oil make it \r\nuseful in reducing&nbsp;acne. Ricinoleic acid can inhibit growth in the \r\nbacteria that cause&nbsp;acne. Texture: Castor oil is also rich in other \r\nfatty acids. These can enhance smoothness and softness when applied to \r\nfacial<b>&nbsp;</b>skin</p>', '<article class=\"col8 -pvs\"><div class=\"card-b -fh\"><h2 class=\"hdr -upp -fs14 -m -pam\">Key Features</h2><div class=\"markup -pam\"><ul><li>Three must have Pantry items</li><li>Sweet almond oil keeps your&nbsp;skin&nbsp;cells healthy,</li><li>Protects your&nbsp;skin&nbsp;from UV radiation damage</li><li>Helps your<b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">&nbsp;</b>skin<b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">&nbsp;</b>look smooth, soft, and free of fine lines</li><li>Contains